import pandas as pd
from transformers import pipeline


input_csv_path = "/content/drive/MyDrive/NLP/Kendi verim/imdb_reviews_processed.csv"
df = pd.read_csv(input_csv_path)


sentiment_analysis = pipeline("sentiment-analysis", model="distilbert-base-uncased-finetuned-sst-2-english")


def analyze_sentiment(text):
    max_length = 512
    truncated_text = text[:max_length]
    result = sentiment_analysis(truncated_text)[0]
    label = result['label']
    binary_label = 1 if label == "POSITIVE" else 0
    return binary_label


df['sentiment'] = df['processed_review'].apply(analyze_sentiment)


header_row = pd.DataFrame([["processed_review", "sentiment"]], columns=df.columns)
output_df = pd.concat([header_row, df], ignore_index=True)


output_csv_path = "/content/drive/MyDrive/NLP/Kendi verim/imdb_reviews_with_sentiment_second_row.csv"
output_df.to_csv(output_csv_path, index=False, header=False)

