import torch
from transformers import AutoTokenizer, AutoModelForSequenceClassification

# Model ve tokenizer'ın kaydedildiği dizin
model_dir = "/content/drive/MyDrive/NLP/Kendi verim/trained_model"

# Model ve tokenizer'ı yükleme
tokenizer = AutoTokenizer.from_pretrained(model_dir)
model = AutoModelForSequenceClassification.from_pretrained(model_dir)

# Modeli değerlendirme moduna alma
model.eval()

# Tahmin fonksiyonu
def predict_sentiment(text):
    # Tokenize etme
    inputs = tokenizer(text, return_tensors="pt", truncation=True, padding=True, max_length=512)

    # Modeli çalıştırma
    with torch.no_grad():
        outputs = model(**inputs)

    # Tahmin edilen sınıfı alma
    logits = outputs.logits
    probabilities = torch.softmax(logits, dim=-1)
    predicted_class = torch.argmax(probabilities, dim=-1).item()

    # Tahmini sınıf ve olasılıkları döndürme
    return predicted_class, probabilities.squeeze().tolist()

# Test örneği
test_text = "This movie was absolutely fantastic! I loved every moment of it."
predicted_class, probabilities = predict_sentiment(test_text)

# Tahmin sonucunu yazdırma
print(f"Metin: {test_text}")
print(f"Predicted Sentiment: {'Positive' if predicted_class == 1 else 'Negative'}")
print(f"Probabilities: {probabilities}")

