import gradio as gr
import torch
from transformers import AutoTokenizer, AutoModelForSequenceClassification

model_dir = "/content/drive/MyDrive/NLP/Kendi verim/trained_model"


tokenizer = AutoTokenizer.from_pretrained(model_dir)
model = AutoModelForSequenceClassification.from_pretrained(model_dir)


model.eval()


def predict_sentiment(text):
    # Tokenize etme
    inputs = tokenizer(text, return_tensors="pt", truncation=True, padding=True, max_length=512)


    with torch.no_grad():
        outputs = model(**inputs)


    logits = outputs.logits
    probabilities = torch.softmax(logits, dim=-1)
    predicted_class = torch.argmax(probabilities, dim=-1).item()

    sentiment = "Positive" if predicted_class == 1 else "Negative"
    confidence = probabilities.squeeze().tolist()[predicted_class]

    return f"Duygu: {sentiment} (Oran: {confidence:.2f})"

# Gradio arayüzü
interface = gr.Interface(
    fn=predict_sentiment,
    inputs=gr.Textbox(lines=3, placeholder="Enter a sentence to classify..."),
    outputs="text",
    title="Duygu Analizi",
    description="Predict whether the input text is Positive or Negative sentiment using a trained DistilBERT model."
)


interface.launch()